import React from 'react';

const Input = ({ type, value, onChange, onKeyPress, placeholder, disabled }) => {
  return (
    <input
      type={type}
      value={value}
      onChange={onChange}
      onKeyPress={onKeyPress}
      placeholder={placeholder}
      disabled={disabled}
      style={{
        flex: 1,
        padding: '10px 15px',
        fontSize: '16px',
        border: '1px solid #e2e8f0',
        borderRadius: '6px',
        outline: 'none',
        transition: 'border-color 0.2s',
        ':focus': {
          borderColor: '#4a6cf7'
        },
        ':disabled': {
          backgroundColor: '#f7fafc',
          cursor: 'not-allowed'
        }
      }}
    />
  );
};

export default Input;
